import React from 'react';
import Main from './Main';
import { Provider } from "react-redux";
import shopStore from '../Redux/shopStore';
import './App.css';
import { BrowserRouter } from 'react-router-dom';


const App = () => {

  return (
    <Provider store={shopStore}>
      <BrowserRouter>
        <Main />
      </BrowserRouter>
    </Provider>
  );
}

export default App;
